INSERT INTO `rets_agent` VALUES (1,181748,'Sterling','Washington',0,'',2528,'','Agent','917-803-8552','','sterling@bizzarroagency.com','','','','',NULL,'','917-803-8552','','','','','','','',1584457634,'','','','','','Sterling Washington','Sterling',1619962584),(2,181214,'Gregory','Maro',1,'',2528,'','Management','917-463-9722','Bizzarro','Greg@BizzarroAgency.com','','','','',1,'','347-994-9065','Gregory.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','Chief Marketing Officer','','Chief Marketing Officer',1580330063,'','','','','','Gregory Maro','Gregory',1619962587),(3,181213,'Angela','Scardina',0,'\"An Upper Manhattan resident for almost 20 years, Angela’s flourishing real estate career is a result of her educators heart and a passion for teaching. A Fulbright Scholar at Fairfield University she continued her love for education by obtaining her Masters Degree from Columbia University’s Teachers College. As one of NYC’s top buyers agent, Angela educates and walks her clients down the path to home ownership through educating them from the beginning to the end removing the “unknowns” for her clients.\r\n\r\nA community pillar, Angela teaches children at the New York Botanical Gardens and Saint Catherine of Genoa Church in Harlem. She is a gardener with the Riverside Oval Association and sings with the Fort Washington Community Choir. She loves art and music, is a phenomenal cook, yogi and enjoys bird watching in a park.',2528,'','Agent','917-794-1456','Bizzarro','Angela@BizzarroAgency.com','','Angela N Scardina','','',NULL,'','347-994-9065','Scardina-Angela.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1602182635,'','','','','','Angela Scardina','Angela',1619962590),(4,181212,'Darryl','Williams',0,'New York City native and Harlem resident, Darryl Williams launched his career in product management immediately after graduating The Fashion Institute of Technology. His entrepreneurial spirit and mastery of client services eventually led him into a flourishing career in real estate.\r\n\r\nDarryl’s non real estate hours are consumed with fitness, health and wellness. He has been vegan for over twenty years and considers himself to be a true “foodie.” Known online as “The Plant Based Junky,” Daryl is on a mission to eat at every vegan restaurant in NYC.',2528,'','Agent','646-319-7740','Bizzarro','Darryl@BizzarroAgency.com','','Darryl Williams','','',NULL,'','347-994-9065','Darryl-Headshot-Small.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1584984870,'','','','','','Darryl Williams','Darryl',1619962592),(5,181211,'Simonne','Hill',0,'With a background in relationship psychology and with a deep love for her community, Simonne enjoys every moment of her time with her clients. As a resident of Upper Manhattan for nearly a decade, Simonne’s intuition and extensive neighborhood knowledge allow her to deliver unprecedented value to her clients.\r\n\r\nWhen Simonne is not practicing real estate, she can be found taking her pup for a walk, rock climbing or enjoying a quiet moment curled up with a good book.',2528,'','Agent','970-846-9417','Bizzarro','Simonne@BizzarroAgency.com','','','','',NULL,'','970-846-9417','Simonne.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1584982846,'','','','','','Simonne Hill','Simonne',1619962595),(6,181210,'Tim','Maggio',0,'\"Over the last two decades, Tim has lived or traveled around the USA, Europe, Central and South America. It wasn’t until moving to New York City did Tim truly find his home among people from a hundred cultures. A long time resident of Washington Heights, Tim brings his talents and local neighborhood expertise to The Bizzarro Agency.\r\n\r\nTim has a passion for world Deaf cultures and sign languages. This passion has sent him all over the globe to work with and live with the Deaf in order to train local Deaf in translation methods.\"',2528,'','Agent','646-283-1440','Bizzarro','Tim@BizzarroAgency.com','','','','',NULL,'','646-283-1440','Tim.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1584983127,'','','','','','Tim Maggio','Tim',1619962599),(7,181209,'Águeda','Ramirez',0,'Águeda knows that real estate is more that property- it’s about the people. Born and raised in Upper Manhattan, Águeda, defines her client centered approach to real estate as fresh and authentic. She began her real estate career to feed her curiosity for people and community while cultivating a career in the arts. Real estate quickly became Agueda’s second passion to the stage. With just under a decade of Uptown real estate experience combined with growing up in the neighborhood, it will be hard pressed to find any agent more knowledgable and loving of Uptown.\r\n\r\nBeyond her work in real estate and her love of the stage, Águeda enjoys practicing sustainable living, herbalism, yoga and community building/outreach.\r\n\r\nÁgueda is fluent in español.',2528,'','Agent','646-752-4019','Bizzarro','Agueda@BizzarroAgency.com','','','','',NULL,'11877','347-994-9065','Agueda.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1611783965,'','','','','','Águeda Ramirez','Águeda',1619962603),(8,181208,'Todd','Fries',0,'\"No stranger to the ever-evolving dynamics of this unique market. Todd is knowledgeable about the many, varying neighborhoods that comprise our remarkable city. Todd is well prepared and excited to help you move through the process of buying, renting and selling your home with ease and enjoyment.\r\n\r\nFinding or selling an apartment or home is an exciting and intensely personal experience. For most people, it is the most significant investment they will make. Todd understands this and is committed to providing each of his clients unparalleled, one on one customer service. He will deliver to you a reality that meets or exceeds your real estate goals and expectations.\r\n\r\nTodd has lived in Manhattan since 1990 and has experienced several of his own real estate transactions from walk-up rentals in the West Village and Chelsea to Washington Heights in 2010 (where he purchased his first apartment from Matthew Bizzarro!).\r\n\r\nA career in book publishing marketing allowed Todd to work with authors on developing and executing effective, market-moving advertising as well as promotion and branding campaigns. After success in his marketing career the transition to real estate was a natural next step. The skills he acquired as a marketer enable Todd to work with you enthusiastically and support you on the exciting journey of finding your next home. Todd looks forward to hearing from you.\"',2528,'','Agent','917-714-8893','Bizzarro','Todd@BizzarroAgency.com','','','','',NULL,'','917-714-8893','Todd.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1584478360,'','','','','','Todd Fries','Todd',1619962605),(9,181207,'Jacquelyn','Sarpong',0,'\"Born and raised in The Bronx, Jacquelyn holds a masters degree in Philosophy of Education from Trident University and a bachelors degree in Computer Science from Monroe College. Before becoming a real estate agent, Jacquelyn spent 10 years working as a career transitional counselor at the Brooklyn Job Corps Academy. It was this counseling experience that fine-tuned her true passion for motivating others by providing them constant support, stability and the moral confidence to pursue their goals. Needless to say it was a seamless transition into real estate.\r\n\r\nWhen not busy working you will find Jacquelyn home spending quality time with her family and “actively” watching the Knicks, Yankees and Jets.\"',2528,'','Agent','917-653-2364','Bizzarro','Jacquelyn@BizzarroAgency.com','','Jacquelyn Yalissa Sarpong','','',NULL,'','917-653-2364','Jacquelyn.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1584984757,'','','','','','Jacquelyn Sarpong','Jacquelyn',1619962610),(10,181206,'Montserrat','Daubon',0,'\"Montserrat considers her first NYC apartment purchase as the most stabilizing event in her life. She is a firm believer in home ownership as it has dramatically transformed her own life. Her passion about home ownership has enabled Montserrat to bring unbridled enthusiasm and efficiency to her client’s home buying pursuits.\r\n\r\nMontserrat walks her clients seamlessly through their purchase process with her precision, skill and extensive knowledge of the market. With a background in international economic development, Montserrat has been trained to handle even the most complex and challenging deals with patience and vigor.\r\n\r\nA resident of Harlem for the last 15 years she has unparalleled knowledge of the Uptown neighborhoods of Manhattan. In her spare time, Montserrat is a painter and sculptor steeped in the Uptown arts scene. She has recently created 3 public sculptures in the city, two of which were prominently displayed in Upper Manhattan.\"',2528,'','Agent','917-704-3336','Bizzarro','Montserrat@BizzarroAgency.com','','','','',NULL,'11877','917-704-3336','Montserrat.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1611783956,'','','','','','Montserrat Daubon','Montserrat',1619962612),(11,181205,'Yodalis','Moran',0,'',2528,'','Agent','646-696-0617','Bizzarro','Yodalis@BizzarroAgency.com','','','','',NULL,'','646-696-0617','Yodalis.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1584983119,'','','','','','Yodalis Moran','Yodalis',1619962614),(12,181204,'Tom','Dawson',1,'\"A resident of Uptown for almost a decade, Tom spent his formative years stationed in Germany while serving in the U.S. Army. Originally from a small town in Maryland, it was his political science major and service in Europe that fostered a lifelong passion for art and architecture.\r\n\r\nAfter serving his country, Tom relocated to Southern California and spent the next twenty-five years building an illustrious career in the telecommunications industry, enjoying the beaches and rooting for the Dodgers. After retiring from the telecom business, Tom moved to New York City to be closer to his three grandchildren.\r\n\r\nAs soon as Tom secured his first apartment Uptown, he immediately dove into Manhattan real estate. His love for European art and architecture combined with his business expertise provided a smooth transition into Tom’s flourishing real estate career. Educating and maneuvering the Uptown market with his clients as Tom explains, “Is my passion, each day with my clients is fun and never feels like work.”\"',2528,'','Agent','310-951-8993','Bizzarro','Tom@BizzarroAgency.com','','','','',1,'','347-994-9065','Tom.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1581611593,'','','','','','Tom Dawson','Tom',1619962616),(13,181203,'Pedro','Paredes',1,'With a passion for business and world cultures, Pedro Paredes graduated from Connecticut College with a double major is Economics and East Asian Studies. He was immediately hired into the business world as a high level consumer banker for JP Morgan Chase. After a few years in the banking industry, Pedro jumped on an opportunity to feed his wanderlust and moved to South Korea to teach ELS (English as a Second Language) to children.\r\n\r\nUpon returning to the States, he immediately settled in Upper Manhattan. Having lived in both Harlem and Inwood, Pedro appreciates Uptown’s diversity and quality of life. Real Estate has become the perfect career for Pedro as it combines his background in economics and banking with his passion for exploration and adventure.\r\n\r\nA South Bronx native, Pedro is fluent in Spanish and conversational Japanese.',2528,'','Agent','646-296-1666','Bizzarro','Pedro@BizzarroAgency.com','','','','',1,'','646-296-1666','Pedro.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','',1600814925,'','','','','','Pedro Paredes','Pedro',1619962619),(14,181202,'Thomas','Rainey',1,'\"Tom has become one of the top real estate agents in Northern Manhattan at a mind blowing pace. After a successful career in Theatre, Tom is very well equipped to put his own spin on the art of the deal. He is an expert at helping clients find the home they want in a neighborhood they love!\r\n\r\nFrom the first day Tom moved into New York City, he was determined to make his mark. Tom has certainly found his niche and he enjoys every minute of providing superior service to his clients as they purchase the brownstone, condo or co-op of their dreams. Since 2001, Tom has lived and worked in Crown Heights, Astoria, Chinatown, Lower East Side, East Village, Hell’s Kitchen, Harlem and now Washington Heights.\r\n\r\nTom is married with a young son and a rambunctious Yorkie named Archie.\"',2528,'','Agent','347-239-3177','Bizzarro','Thomas@BizzarroAgency.com','','Thomas Rainey','','',1,'','347-994-9065','Thomas.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','','','Licensed Real Estate Salesperson',1580418889,'','','','','','Thomas Rainey','Thomas',1619962621),(15,181201,'Matthew','Bizzarro',1,'Matthew Bizzarro is the Broker/Owner of The Bizzarro Agency, Founder of Be GREAT In Real Estate, and a local real estate coach. He has transformed the real estate market in Upper Manhattan with a fresh, cutting edge and honest approach. Matthew is widely regarded as one of the most knowledgeable and well-connected brokers. ',2528,'','Management','917-856-6015','Bizzarro','Matthew@bizzarroagency.com','','','10491203283','',1,'','347-994-9065','Matthew.jpg','http://localhost/bizzhub/storage/web/rets/agent_image/','','','Licensed Real Estate Principal Broker/Owner','','',1581611596,'','','','','','Matthew Bizzarro','Matthew',1619962623),(16,181200,'Laura','Zirkle',1,'',2528,'','Staff','917-557-3