INSERT INTO `rets_property` VALUES (1,'4260 Broadway','address_and_unit','4260 Broadway 606',181202,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/242/large/Thomas.jpg?1580250117','Live',2528,'Bizzarro Agency LLC','',1,NULL,'RM',NULL,1,NULL,NULL,29468,1,'',1,NULL,1,NULL,1,'New York',NULL,3,NULL,1635739200,'',6,NULL,NULL,NULL,704,NULL,1,'40.850311',1619616228,815000,1133,'https://bizzarroagency.com',1,'-73.935146','All showings are \"By Appointment Only\" with signed Covid Forms.\n\nWelcome to quintessential New York chic at 4260 Broadway!\n\nThis spacious, open concept 3 BR, 2 BA home combines the elegance of up-to-date finishes with just enough of that city “edge”. Exposed brick in common area and bedrooms presents immense character and texture. Large, inviting eat-in kitchen features stainless steel appliances including a dishwasher and huge two-door refrigerator. Generous modern cabinetry means home chefs will have plenty of room for small specialty appliances, gadgets, and a coveted stash of favorite ingredients. Bathrooms have a luxury spa feel with floor to ceiling tile; warm, sleek glass shower doors, and contemporary fixtures. \n\nThoughtful design touches help maximize natural light and a sense of space, like the floor-to-ceiling mirrors spaced intelligently along the hall (and these aren’t your grandma’s mirrors). The third bedroom features a paneled sliding door with frosted glass panes that pours extra sunlight into an already well-lit living area, and can be pushed back the entire length of the room for flexible use of space. Closets in all bedrooms, plus a coat closet upon entry and an additional hall closet.','',NULL,'Fort George',NULL,2,3,NULL,5,113,6,815000,'Condo',540,582,'S',NULL,'NY',100,1619616228,NULL,NULL,1,606,1619616420,'https://my.matterport.com/show/?m=xyK9T9y9jWo',1,1,1,1,1969,10033,1,NULL,NULL,'PRCH-3320368',1,'Fort George',NULL,NULL,NULL,'',NULL,NULL,NULL,1617892800),(2,'37 Nagle Avenue','address_and_unit','37 Nagle Ave. 5A',181201,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/241/large/Matthew.jpg?1580249072','Live',2528,'Bizzarro Agency LLC','',1,1,'D4',NULL,1,1,1,42652,1,'',1,NULL,NULL,NULL,1,'New York',NULL,2,1,1635739200,'Contact Company Management',5,NULL,NULL,1,820,NULL,1,'40.859377',1619707377,389000,NULL,'https://bizzarroagency.com',1,'-73.929662','High Floor Courtyard 1BR!\nLight floods this lovely, court-yard facing apartment through the southern and eastern exposures. A spacious open concept living and dining area flow perfectly into the updated kitchen. Renovated high end bathroom, massive closets, and restored hardwood floors throughout. Co-op amenities include a gym, newly designed courtyard, children\'s playground, laundry, storage, live-in super and bike room. Indoor valet parking is available. Pet friendly!\n\nThe motto of this co-op is perfect: “A Great Place to Live.” Located in the Ft. George section of Washington Heights, this co-op sits at the foot of Ft. Tryon Park. Part of a three building co-op with excellent financials, 37 Nagle is a pet-friendly building that boasts of all the amenities of New York City living. There is a large outdoor common area and children’s play space where the building community has frequent social gatherings. In addition to this expansive space there is a tranquil garden area where residents may relax on benches and enjoy a retreat away from the hustle and bustle of the city. Not enough time to workout with your busy schedule? No worries, there is a fitness room with all modern workout equipment in the complex! A laundry room, live-in super, parking garage and storage round out the amenities.\n\nJust around the corner is the entrance to Ft. Tryon Park where you can walk, run, bike, hike, relax or head up to the free summer jazz performances at numerous Uptown hot spots. Numerous local restaurants, wine bars and tapas establishments will tempt your pallet as you enjoy life in Ft. George. This location is ideal for transportation with the express A-train, 1-train and express bus stops a few minutes around the corner.','',90,'Fort George',NULL,1,1,NULL,3,111,6,389000,'Co-op',550,NULL,'S',NULL,'NY',100,1619707376,NULL,NULL,NULL,5,1619707377,'https://my.matterport.com/show/?m=hzMYv5E8ys8',1,1,1,1,1951,10040,NULL,NULL,NULL,'PRCH-3320287',1,'Fort George',NULL,NULL,NULL,'',NULL,NULL,NULL,1617890389),(3,'4 Bogardus Place','address_and_unit','4 Bogardus Place 2F',181201,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/241/large/Matthew.jpg?1580249072','Live',2528,'Bizzarro Agency LLC','',1,1,'D4',NULL,1,1,NULL,31374,1,'',1,NULL,NULL,NULL,1,'New York',NULL,2,NULL,1635739200,'Contact Company Management',2,NULL,NULL,NULL,656,NULL,1,'40.859051',1619094779,399000,NULL,'https://bizzarroagency.com',1,'-73.929993','STUNNING!\nThis masterpiece apartment has been gut renovated to the highest architectural and design standards. The gorgeous kitchen features high-end cabinetry, polished quartz countertops and stainless steel appliances including a Bertazzoni stove. The spacious oversized living room compliments the custom storage and dining nook. A modern designed bedroom with wall-to-wall closets pairs perfectly with the oversized hotel spa inspired bathroom. Hand selected designer finishes and high-end fixtures make this a truly unique home. Dog and cat friendly! Assessment of $18.93/mo. thru September 2022 (new building elevator) and $19.69/mo. (new building water pipes) end date tbd.\n\nTucked away, Bogardus Place is a tree-lined street that is the perfect escape from the hustle and bustle of the city. 4 Bogardus Place is a pet-friendly, elevator building with numerous amenities such as a live-in super, laundry, storage room and garage. Beautiful gardens surround the building and welcome you with amazing colors and arrangements. Outdoor space allows shareholders the ability to bask in the sun without leaving home. 4 Bogardus Place is one block away from Ft. Tryon Park and a short distance to both the A and 1 trains.','',80,'Fort George',NULL,1,1,NULL,3,35,6,399000,'Co-op',550,NULL,'S',NULL,'NY',100,1619094779,NULL,NULL,NULL,2,1619690907,'https://my.matterport.com/show/?m=A1NzHRCF4Bq',1,1,1,1,1920,10040,1,NULL,NULL,'PRCH-3320267',1,'Fort George',NULL,NULL,NULL,'',NULL,NULL,NULL,1617889165),(4,'17 Chittenden Avenue','address_and_unit','17 Chittenden Ave. 5D',181201,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/241/large/Matthew.jpg?1580249072','Live',2528,'Bizzarro Agency LLC','',1,1,'D4',NULL,1,NULL,NULL,36022,1,'',1,NULL,1,1,1,'New York',NULL,2,NULL,1633060800,'tbd',5,NULL,NULL,NULL,1140,NULL,1,'40.855143',1619032687,639000,NULL,'https://bizzarroagency.com',1,'-73.938945','Welcome to a 17 Chittenden Masterpiece!\nBright and airy this open concept 1BR is a graceful melding of modernity with classic “New York apartment” details like crystal doorknobs and hardwood floor inlays.\nThe expansive kitchen was meticulously renovated with custom white glass door cabinetry, quartz countertops, marble backsplash, high end finishes and a stainless steel appliance package including dishwasher. This is the ultimate kitchen for cooking and entertaining with the chic white quartz breakfast bar and matching barstools.\n\nIn the living area, a 3-panel sliding door offers endless options for creative use of space, whether you work from home, want a dedicated workout space, or need extra sleeping accommodations. The frosted glass panels mean you won’t sacrifice natural light. Spacious corner bedroom, renovated marble bathroom, ample closet space and hardwood floors throughout.\n\nLive your best NYC life with glittering views of the GW Bridge from the roof deck at night, and sun-drenched lounging by day. Enjoy quiet moments in the verdant outdoor nook that’s tucked behind the building with its English garden feel.','',80,'Hudson Heights',NULL,1,1,NULL,3,33,6,639000,'Co-op',550,NULL,'S',NULL,'NY',100,1619032687,NULL,NULL,NULL,5,1619690807,'https://m