ized second bedroom is currently used as a home office and guest room with a built-in retractable bed.\n\nThe large North-facing windows, coupled with the open layout, make it the perfect space for entertaining and hosting events. You’ll notice immediately that there is plenty of room for a baby grand piano and full dining room table.\n\nAll appointments must provide updated signed COVID disclosures before confirming appointment\n\nThe Kalahari is a Gold LEED certified building with a plethora of amenities, which include a 24-hour doorman, package room, two roof decks, a children’s playroom, state-of-the-art gym, onsite zip car, and much more! Each floor has access to a separate laundry room as well. All of the common areas have a filtered-air system and complimentary high-speed wifi.\n\nBoth Central Park and Mt. Morris Park are a short walk from The Kalahari. The building is steps away from the 2,3,6,B,C subway lines and major bus lines as well. The neighborhood is full of popular restaurants, such as Sylvia’s and Red Rooster! When you don’t feel like eating out, Whole Foods is a few short blocks away. The building has a 25 year tax abatement with 14 years left to go, which means low monthly taxes!','',NULL,'Harlem',NULL,2,2,NULL,5,249,12,1195000,'Condo',540,16,'S',NULL,'NY',100,1603975562,NULL,NULL,NULL,0,1619528407,'https://my.matterport.com/show/?m=kJkejzi6JVu&mls=2',1,1,1,1,2007,10026,NULL,NULL,NULL,'PRCH-3203567',1,'Harlem',NULL,NULL,NULL,'',NULL,NULL,NULL,1602689137),(16,'45 Tudor City Place','address_and_unit','45 Tudor City Place 818',181201,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/241/large/Matthew.jpg?1580249072','Live',2528,'Bizzarro Agency LLC','',1,1,'D4',1,1,NULL,NULL,23618,1,'',NULL,NULL,1,1,1,'New York',NULL,0,NULL,1612069200,'',8,NULL,NULL,NULL,0,NULL,1,'40.749347',1600569165,2250,NULL,'http://www.bizzarroagency.com',1,'-73.969993','River and Park Views!\nThis corner unit at Prospect Tower is beaming with sunshine and breathtaking view of Tudor City parks and the East River. An open concept with renovated bathroom, endless built-in\'s with tons of closet space and hardwood floors throughout. Classic charm, incredible views and the comfort of home in the heart of Murray Hill. \n\nEnjoy life in Tudor City in this full service building with an extraordinary roof deck! The building amenities include a 24-hour doorman, fitness room, elevator, laundry room and a breathtaking view from the roof deck. Located in the heart of Murray Hill, Tudor City is centrally located within minutes of almost everything.','',NULL,'Tudor City',NULL,1,1,NULL,3,403,25,2400,'Co-op',550,NULL,'R',NULL,'NY',100,1613776090,NULL,NULL,NULL,818,1613776090,'https://my.matterport.com/show/?m=cTcVkKxw4BV',1,1,1,1,1929,10017,NULL,NULL,NULL,'PRCH-3114772',1,'Tudor City',NULL,NULL,NULL,'',NULL,NULL,NULL,1600569165),(17,'69 Bennett Avenue','address_and_unit','69 Bennett Ave. 501',181201,'https://s3.amazonaws.com/babylon_prod/users/pictures/000/027/241/large/Matthew.jpg?1580249072','Live',2528,'Bizzarro Agency LLC','',NULL,NULL,'R4',NULL,1,1,NULL,24233,1,'Bennett Sixty-Nine',1,NULL,NULL,NULL,NULL,'New York',NULL,2,NULL,1625025600,'Contact Management Company',5,NULL,NULL,NULL,410,NULL,1,'40.852597',1596722132,479000,NULL,'http://www.bizzarroagency.com',NULL,'-73.935291','Renovated 1BR CONDO @ Bennett Sixty-Nine\nINVESTOR FRIENDLY\n\nThis modern 1BD/1BA condo features an open layout chef’s kitchen with white custom cabinetry, quartz countertops, glass tile backsplash and a suite of stainless steel appliances including a dishwasher. The open layout living room flows perfectly into the dining and kitchen areas and displays the pristine Oak hardwood floors. The main bedroom features a king-sized bed, double walk-in closets, and a beautiful renovated bathroom with high end fixtures.\n\nBennett Sixty-Nine is perfectly located at the corner of Bennett Ave and 184th Street. This location places the building one block away from the A train (181st stop) and a few blocks from the 1 train. Building amenities include live in super, laundry, elevator and pet friendly. A few blocks away from Ft. Tryon Park, Bennett Park and all the restaurants and shopping that Hudson Heights and WaHi has to offer.','',NULL,'Hudson Heights',NULL,1.5,1,1,3,60,6,499000,'Condo',540,175,'S',NULL,'NY',100,1610125735,NULL,NULL,NULL,501,1614870139,'',1,1,1,1,1954,10033,NULL,NULL,NULL,'PRCH-3018062',1,'Hudson Heights',NULL,NULL,NULL,'',NULL,NULL,NULL,1596722132);
